{'id': '15432662', 'text': 'Felipe and I had a great time in DK. 
Felipe is curious and talkative. He is a helpful and fair guest, who takes his share in cooking, cleaning and paying for beers and booze ;) 

I really enjoyed our few days biking, walking, drinking, discussing and cooking :)', 'createdDate': '2014-05-31T14:59:01Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '2714802'}, 'from': {'id': '707534', 'publicName': 'Miki Dam Larsen', 'publicAddress': {'id': '3412657', 'description': 'Alleroed, Capital Region of Denmark, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/707534/CE3ECB02-77EF-4852-BD4E-1680A1052A29', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '15901291', 'text': "Niki and James are pro CS hosts, don't let their newbie status fool you! Even though we arrived later than intended, Niki was waiting for us with a ready-made bed and two glasses of water for the night (how did you know?!) and much more hospitable excitement than you would expect from someone after their bedtime. 

We didn't spend nearly enough time talking about the wonderful world of animals, traveling, growing up on the internet (and statistics?), because we were only in town for a wedding and my mind and attention were mostly on that event, but Niki braided my hair for the wedding and prepared us some super-energizing orange juice and generally made us feel really pampered (even though we were wearing silly fancy grownup outfits)! Such a lovely lovely CS experience (despite the lack of time), I can't recommend them enough!

Until next time :)", 'createdDate': '2014-07-29T18:22:20Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '1006393324'}, 'from': {'id': '1743532', 'publicName': 'Armina', 'publicAddress': {'id': '4448654', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1743532/4d7c65ce-8504-418a-a100-9e4f56f5679c', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '12049637', 'text': 'Though new to the CS site, Karen has basically lived the CS way her entire life. Assisted by another of her CSers, Karen drove +40 miles from where she was, through a snow storm(!!), to pick me up from a truck stop where my hitchhiking luck had ended, and take me back to Roswell, more than 100 miles from my initial location. That's crazy generous and I don't call her my saviour lightly!

And then her "log" house, a dream for any space- and/or dragon-nerd. As soon as I got there, I forgot all about my plans to sightsee around the city proper and was left in awe of her bookshelves and dragon-friends! I could go on and on about my brief time in with Karen, but it'd all amount to: she's a fantastic person to meet and chat with, and will introduce you to a bunch of fascinating ideas and plans you never even considered. 

Karen, I hope that next time I see you, I'll be riding some form of motorised vehicle :)', 'createdDate': '2012-12-12T23:50:09Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '4557664'}, 'from': {'id': '1743532', 'publicName': 'Armina', 'publicAddress': {'id': '4448654', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1743532/4d7c65ce-8504-418a-a100-9e4f56f5679c', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '6627925', 'text': "vincent was cuddly and aggressive towards my toiletries kit, dennis was fun despite the lack of bad music, but, truly, the star of the show was gaga, with her soft hair and warm bathrobe! oh, that bathrobe...

even though we didn't get to spend as much time together as i would have liked to, i felt very welcome and comfortable at gaga's place and would love to meet up with her again in the near future (either in amsterdam, poland or the uk)!

thank you :)", 'createdDate': '2011-01-29T16:43:31Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '1570471'}, 'from': {'id': '1743532', 'publicName': 'Armina', 'publicAddress': {'id': '4448654', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1743532/4d7c65ce-8504-418a-a100-9e4f56f5679c', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '11747903', 'text': "Kristina and I shared a couch (and a host) in Quebec over a weekend. Although she'd visited the city before, she was generous enough with her time to spend a couple of days showing me around the main attractions. I felt very comfortable in her presence, for she is enthusiastic and friendly and definitely mature for her age.

Je suis d√©sol√©e je suis parti de Qc sans te souhaiter Bon voyage, mais j'esp√®re de peut √™tre te revoir en l'amerique du nord. Bonne chance!*

(*entirely without google translate! :) )", 'createdDate': '2012-10-31T05:31:26Z', 'experience': 'positive', 'relationshipType': 'other', 'isPostTrip': False, 'to': {'id': '4662214'}, 'from': {'id': '1743532', 'publicName': 'Armina', 'publicAddress': {'id': '4448654', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1743532/4d7c65ce-8504-418a-a100-9e4f56f5679c', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '10100146', 'text': "catherine was a wonderful couchsurfer! even though i spent half of the time she was in st andrews working, and even though the weather wasn't welcoming at all, catherine maintained her optimism and enthusiasm and was a pleasure to hang out with. she apologised several times for being very talkative, but the funny part is that she made me very talkative as well(!). she's a very open, friendly person, and has many exciting adventures and plans to share, so our exchange of experiences and ideas has left me feeling positive and inspired!

i'm looking forward to seeing her again soon, when i come over to canada :)


part deux: completely unsurprisingly, catherine is as welcoming and gracious a host as she was a guest! if you have the opportunity to chat with her about canada, be prepared for some professional-level knowledge... and, whatever you do, remember to remove the bay leaf!", 'createdDate': '2012-05-09T18:50:28Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '472440'}, 'from': {'id': '1743532', 'publicName': 'Armina', 'publicAddress': {'id': '4448654', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1743532/4d7c65ce-8504-418a-a100-9e4f56f5679c', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '7723662', 'text': 'erin was full of energy and enthusiasm and i was thrilled to have her as my travelling companion on my last day (so far) in iceland! despite some panic-worthy situations along the way (will we find the delicious restaurant? will we make it to the airport in time? will she get to where she was supposed to meet her friends?), she maintained her great, positive outlook. 

best of luck and i look forward to seeing you again (which will happen sooner than later, i know it, just like iceland :) )


part deux: and it did happen! erin made a stop in my little seaside university town on her way around UK and, even though i was a bit of a distracted host (because of my overwhelming school deadlines), she was a great surfer/friend! she cooked us food, and kept us company when we were going crazy with our work, and shared her life with ours, and, all in all, made for pleasant company in our home!', 'createdDate': '2011-06-30T17:13:01Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '11242'}, 'from': {'id': '1743532', 'publicName': 'Armina', 'publicAddress': {'id': '4448654', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1743532/4d7c65ce-8504-418a-a100-9e4f56f5679c', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '15473872', 'text': "My dear friend, Nila ^^ I know Nay pretty well and I certainly consider her among my best friends. She is a very smart and cheerful person with interesting ideas and points of view about life to share. That kind of people that will pour joy to your days (and nights) and you'll definitely enjoy hanging around with. Wise words, ambitious mind, and truthful recommendations! We had together many anecdotes and I can't seem to remember bad time spent with this lovely friend! 

Now she's about to start her backpacking adventure... if I were you, I wouldn't loose the chance of meeting her in the road! I'm not sure about her cooking skills that she mentioned but for sure you will get useful tips for improving your photographs and meet a wonderful girl!

Good luck in the upcoming adventure, mi amiga, and let the traveling wind guide the sail of your adventure! In the meantime, here we'll be in charge of missing you!", 'createdDate': '2014-06-05T23:22:13Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '1005887497'}, 'from': {'id': '3457621', 'publicName': 'Fernando Nicolosi', 'publicAddress': {'id': '6162742', 'description': 'Copenhagen, Capital Region of Denmark, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/3457621/00EF6BE5-59AB-4995-BE84-0AD7FC4920D5', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '14799095', 'text': 'una copada esta Renataaa! Antes de llegar a Mosc√∫ nos escribimos algunos mensajes y cuando nos encontramos sent√≠ que ya nos conoc√≠amos de hac√≠a a√±os ))) una persona con muy buenas ideas, habilidad √∫nica para los idiomas, muchas ganas de cantar y un gran sentido del humor! 

Despu√©s de tener varios cambios en mis planes me hosped√≥ en su casa por una noche sin problemas y me mostr√≥ algunos rincones ocultos de Mosc√∫ (p√≠danle que los lleve al "caf√© copado"). De esas personas que a uno le gustar√≠a que viviera m√°s cerca para poder seguir contagi√°ndose de su locura e ideas!

Gracias Renati√±a )) Suerte en todos tus futuros planes!', 'createdDate': '2014-02-24T10:32:32Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '3602596'}, 'from': {'id': '3457621', 'publicName': 'Fernando Nicolosi', 'publicAddress': {'id': '6162742', 'description': 'Copenhagen, Capital Region of Denmark, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/3457621/00EF6BE5-59AB-4995-BE84-0AD7FC4920D5', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '13158365', 'text': 'I had great time with Cris during my staying in Poland and in our bike trip together! He has big ideas and the energy to go through them successfully... although we didn't know previously he shared with me the idea of making a trip together and from the very beginning we made a great friendship. As I kept traveling he invited me to go back to Poland in December to join him and his adorable family in order to spend Christmas together! 

He was always carrying about my needs and we had lot of fun! Hopefully we will meet once again, for more adventures, beers, talks, mate and sake!! Totally recommended host/guest which I can't wait to receive in Argentina!

Mucha suerte amigo en todas tus pr√≥ximas aventuras y buena vida para vos, Wojteck, Ola y todos los buenos polacos! )) You know, "we are driving home for Christmas!" ;)', 'createdDate': '2013-05-31T02:38:29Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '1001307933'}, 'from': {'id': '3457621', 'publicName': 'Fernando Nicolosi', 'publicAddress': {'id': '6162742', 'description': 'Copenhagen, Capital Region of Denmark, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/3457621/00EF6BE5-59AB-4995-BE84-0AD7FC4920D5', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '15264607', 'text': 'Daniela is a very sweet and curious girl. I really enjoyed her company and being her host. We had a lot of interesting talks about cultural differences between the Brazilian and Danish ways of living, and I learned a lot of things about Brazil that I didn't know before.

I asked Daniela to write down the lyrics of " The Girl from Ipanema" and she taught me how pronounce the difficult Portuguese language. So now I have to practice the song :)

I can certainly recommend Daniela as you next guest, and I really hope I will have a chance to meet this wonderful girl once more sometime in the future :-)', 'createdDate': '2014-05-07T19:16:48Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '1001370220'}, 'from': {'id': '1004274185', 'publicName': 'Sune Fuglede', 'publicAddress': {'id': '10878759', 'description': 'Copenhagen, Capital Region of Denmark, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/5HO9J5CSK/24628088_l_60e48603a59fb1600154498c6558a323.jpg', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '15398238', 'text': "Laura is a very friendly and open minded person and I liked hosting her, so she could get some vacation. She's a very independent person and I was impressed by the long list of things she wanted to see in Copenhagen, and I'm sure she managed it. We had some nice conversations in the evening and we came along very well. 

The only thing I missed was her lack of French accent while speaking English( which I think sounds so funny), cause she had already stayed for a long in the UK :)

I can really recommend Laura as your next guest, she is a very easy guest to host.", 'createdDate': '2014-05-26T19:55:54Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '1003595061'}, 'from': {'id': '1004274185', 'publicName': 'Sune Fuglede', 'publicAddress': {'id': '10878759', 'description': 'Copenhagen, Capital Region of Denmark, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/5HO9J5CSK/24628088_l_60e48603a59fb1600154498c6558a323.jpg', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

