{'id': '5354411', 'text': 'Riana and Romain were great hosts. Very nice, and easygoing and with great taste in music and food :)

Riana was good for a nice talk halfway through the night. She is definatly welcome at my couch any time. :p
', 'createdDate': '2010-07-23T20:21:48Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '815473'}, 'from': {'id': '1922243', 'publicName': 'Thomas Michelsen', 'publicAddress': {'id': '4627365', 'description': 'Copenhagen, Capital Region of Denmark, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/CVSGGVP/18859860_l_57bd4bc3c70852b12b1c8530b72df780.jpg', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '14087300', 'text': 'Trevor and Jason were great guests. They stopped by Copenhagen on their 3 month trip around Europe. They seem like they can get along with anyone, and it was very interesting to hear about their travels, which they also blogged about. And if you need some good beer advice they should be the ones to ask.

Thank you for taking me out for dinner and drinks guys! I hope to see you again soon.

You will definitely have a great experience with Trevor if you host him.', 'createdDate': '2013-10-20T18:51:54Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '1001324563'}, 'from': {'id': '2144715', 'publicName': 'Andreas L√∂wenborg', 'publicAddress': {'id': '4849837', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/2144715/9b3f4027-49cb-4ad0-ab5c-bc36f91e4448', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '13608822', 'text': "David is a relaxed, sweet young man ... who are curious about life and people ... and passionate of music and other things in the world ... making it easy to get the conversation to start. 

It was cozy and uncomplicated to host David. When we did not hung out together. He had a good situational awareness and was sweet to help with cleanup and cook. 

I would without a doubt recommend David and it's so nice when he pottering about and whistles ... :0)", 'createdDate': '2013-08-05T22:40:16Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '3558454'}, 'from': {'id': '1001827429', 'publicName': 'Lars Werner Thomsen', 'publicAddress': {'id': '9441728', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1001827429/1271E811-8CA3-4124-92E6-94A68C0ADE2D', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '16511131', 'text': 'Julia was really great and easy to have around. I was crazy busy as I was arranging a 70-person birthday party including a three course dinner so had almost no time to spend time with or give Julia any attention.

However, she seemed to do splendidly on her own. I am really glad you enjoyed the party.

My only regret is that I never got to know you more than I did. You are always very welcome to come back. And you should:) I sincerely hope to meet you and get to know you sometime in the future.', 'createdDate': '2014-10-16T13:03:05Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '1627812'}, 'from': {'id': '1163674', 'publicName': 'Glenn Kaiser', 'publicAddress': {'id': '3868797', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/7SI1O3P/23514580_l_0ef17fc0ebcc5059cc93742c9fb129ed.jpg', 'status': 'yes', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '15069301', 'text': 'The evil twins Lilli and Johanna were great to have around:) They arrived right when I was going for one off my all out 3 course CS dinners so I didnt have a lot of time to hang out unfortunately. However, they were very cheerful, laughed a lot so it was a pleasure having them stay.

Hope you enjoyed your last while in Copenhagen and got the most out of your last few days of vacation:)

Take care', 'createdDate': '2014-04-09T15:55:36Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '1002025139'}, 'from': {'id': '1163674', 'publicName': 'Glenn Kaiser', 'publicAddress': {'id': '3868797', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/7SI1O3P/23514580_l_0ef17fc0ebcc5059cc93742c9fb129ed.jpg', 'status': 'yes', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '15069222', 'text': "Yurika was really nice to have around. Always cheerfull and smiling and a really kind and sweet person.

She stayed while I was having one of my all 3 course out dinners for 35 CS'ers and friends and even helped me out. Btw. we were brushing the mushrooms to avoid having them absorb the water and go mushy when washing them:)

I hope to see you somewhere, sometime in the world. Take care, Yurika", 'createdDate': '2014-04-09T15:40:43Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '1005116208'}, 'from': {'id': '1163674', 'publicName': 'Glenn Kaiser', 'publicAddress': {'id': '3868797', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/7SI1O3P/23514580_l_0ef17fc0ebcc5059cc93742c9fb129ed.jpg', 'status': 'yes', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '15069241', 'text': 'Alina and her friend Carla were amazingly nice to have around. They were really sweet girls, fun to have around and really easygoing. Despite getting thrown into the middle of my dating life on the first night they were not frightened off:)

I hope to see the both of you sometime in a maybe not too distant future when I travel through Germany.

Take care:)', 'createdDate': '2014-04-09T15:44:17Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '3039468'}, 'from': {'id': '1163674', 'publicName': 'Glenn Kaiser', 'publicAddress': {'id': '3868797', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/7SI1O3P/23514580_l_0ef17fc0ebcc5059cc93742c9fb129ed.jpg', 'status': 'yes', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '10151099', 'text': 'Hi Ivana

Great having you stay for a couple of nights. Hope to see you again sometime:)

To everyone out there dont hesitate having Ivana staya t your place. She is fun, outgoing and interesting. She will spent time with you as well as go off on adventures on her own.', 'createdDate': '2012-05-16T09:53:33Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '4229216'}, 'from': {'id': '1163674', 'publicName': 'Glenn Kaiser', 'publicAddress': {'id': '3868797', 'description': 'K√∏benhavn, K√∏benhavn, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/7SI1O3P/23514580_l_0ef17fc0ebcc5059cc93742c9fb129ed.jpg', 'status': 'yes', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '12272767', 'text': 'Fifi! You are an amazing guest! So much fun to be around and definitely living the moment!! My friends and I just looove you! Thanks for an amazing evening with lots of party and alternative concerts on Christiania. 
Well done on the bike and thanks for making pancakes. 

Feel free to visit again (ps. sry for the late reference)', 'createdDate': '2013-01-18T14:18:02Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '1756095'}, 'from': {'id': '3294927', 'publicName': 'Rune Molin', 'publicAddress': {'id': '6000048', 'description': 'Frederiksberg, Capital Region of Denmark, Denmark'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/M4FXEXA/15299903_l_7611e1f1529ec866db8361e53ce7df77.jpg', 'status': 'no', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '11550683', 'text': 'Miss Veiga is one of those persons you instantly click with. Cris is smiling all the time, positively tuned and easy-going. Thanks for many laughs and good talks! 

We had a great bicycle trip around Copenhagen. Took great pictures and saw local sights. You did so well on the bike!

