{'id': '1166330', 'text': "Toni is awesome, he's mister CouchSurfing in Warsaw. When we arrived in Warsaw late at night, he took us to a great big couchsurfing meetup and then to a club where we danced and drank the night away. 

But that was not enough, he took us to delicious kebabs in the middle of the night, and then took us home to his place where we partied with some local Couchsurfers until 5 in the morning. Then we slept for 4 hours and had the best breakfast of our lives. 

