{'id': '1114234', 'text': "I met Dagem in Copenhagen at a CS Picnic. Then I was in the lucky situation that I was going to Stockholm where he hosted me 'in absentia'. I had the best time, it was just too bad that he wasn't there, because I'm sure I would have had an even better time with him there.

